def time_stamp(time_birthday):
    if time_birthday.split(':')[-1][0] == ' ':
        time_birthday = time_birthday.split(':')[-1][1:]
    time_format = datetime.datetime.strptime(time_birthday, '%d %B, %Y')
    timeArray = time.strptime(str(time_format), "%Y-%m-%d %H:%M:%S")
    timeStamp = int(time.mktime(timeArray))
    today = date.today()
    age = today.year - time_format.year - ((today.month, today.day) < (time_format.month, time_format.day))
    return timeStamp,age





import io
from PIL import Image
import requests

def download_img(img_url,name,content):
    res = requests.get(img_url)
    byte_stream = io.BytesIO(res.content)
    roiImg = Image.open(byte_stream)
    imgByteArr = io.BytesIO()
    roiImg.save(imgByteArr, format='PNG')
    imgByteArr = imgByteArr.getvalue()
    with open('./' + content + '/' + name + ".png", "wb") as f:
        f.write(imgByteArr)


